'use strict';

const Status = {
  NOT_CONNECTED: 1,
  CONNECTING: 2,
  AUTHENTICATING: 3,
  CONNECTED: 4,
  CLOSING: 5,
  CLOSED: 6
};

module.exports.Status = Status;
